import { StyleSheet } from 'react-native';

export default StyleSheet.create({
    wrapper: {},
    slide1: {
      flex: 1,
      justifyContent: 'center',
      alignItems: 'center',
      backgroundColor: '#684A35',
    },
    slide2: {
      flex: 1,
      justifyContent: 'center',
      alignItems: 'center',
      backgroundColor: '#684A35',
    },
    slide3: {
      flex: 1,
      justifyContent: 'center',
      alignItems: 'center',
      backgroundColor: '#684A35',
    },
    title: {
      fontFamily: 'DMMono-Med',
      color: '#FFE9D0',
      fontSize: 30,
      fontWeight: 'bold',
      paddingBottom: 5,
    },
    text: {
      color: '#FFE9D0',
      fontSize: 20,
      paddingLeft: 60,
      paddingRight: 60,
    },
    button: {
      padding: 20,
      color: '#FFE9D0',
    },
